import React, { Component } from "react";

class Dashboard extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <main className="container">
          <div>
            <h1>DashBoard</h1>
          </div>
        </main>
      </React.Fragment>
    );
  }
}

export default Dashboard;
